import React from 'react';

function ProjectThumbnail(props) {
        return (
                <div className="project-rect">
                        <img src={props.src} alt={props.alt}/>
                        <h4><a href={props.href}>{props.projectName}</a></h4>
                </div>
        );
}

export default ProjectThumbnail;
